import React, { useEffect, useState } from 'react';
import {
  Container,
  Typography,
  Button,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Slider,
  TextField,
  Box,
  Stack
} from '@mui/material';
import DeviceAnalytics from './DeviceAnalytics';

function App() {
  const [devices, setDevices] = useState([]);
  const [selectedDevice, setSelectedDevice] = useState(null);
  const [openEditDialog, setOpenEditDialog] = useState(false);

  useEffect(() => {
    fetch('http://localhost:5001/api/devices')
      .then(res => res.json())
      .then(setDevices)
      .catch(err => console.error('Error fetching devices:', err));
  }, []);

  const handleEditDialogOpen = (device) => {
    setSelectedDevice(device);
    setOpenEditDialog(true);
  };

  const handleEditDialogClose = () => {
    setOpenEditDialog(false);
    setSelectedDevice(null);
  };

  const handleSliderChange = (field, value) => {
    const updatedDevices = devices.map(device =>
      device.Did === selectedDevice.Did ? { ...device, [field]: [...device[field], value] } : device
    );
    setDevices(updatedDevices);
    updateDeviceOnServer(selectedDevice.Did, field, value);
  };

  const updateDeviceOnServer = (Did, field, value) => {
    fetch(`http://localhost:5001/api/devices/${Did}`, {
      method: 'PUT',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({ [field]: value }),
    })
    .then(res => res.json())
    .then(() => {
      console.log('Device updated successfully');
    })
    .catch(error => console.error('Error updating device:', error));
  };

  return (
    <Container maxWidth="md">
      <Typography variant="h4" sx={{ mt: 4, mb: 2 }}>Device Management System</Typography>
      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Device ID</TableCell>
              <TableCell align="right">Water Flow</TableCell>
              <TableCell align="right">Pressure</TableCell>
              <TableCell align="right">Temperature</TableCell>
              <TableCell>Edit</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {devices.map((device) => (
              <TableRow key={device.Did}>
                <TableCell component="th" scope="row">
                  {device.Did}
                </TableCell>
                <TableCell align="right">{device.waterFlow.slice(-1)}</TableCell>
                <TableCell align="right">{device.pressure.slice(-1)}</TableCell>
                <TableCell align="right">{device.temperature.slice(-1)}</TableCell>
                <TableCell>
                  <Button onClick={() => handleEditDialogOpen(device)}>Edit</Button>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      {selectedDevice && (
        <Dialog open={openEditDialog} onClose={handleEditDialogClose} fullWidth maxWidth="sm">
          <DialogTitle>Adjust Device Data</DialogTitle>
          <DialogContent>
            <Box sx={{ mt: 2 }}>
              <Typography gutterBottom>Water Flow (L/s)</Typography>
              <Slider
                value={selectedDevice.waterFlow.slice(-1)[0]}
                onChange={(e, val) => handleSliderChange('waterFlow', val)}
                min={0}
                max={100}
                step={1}
              />
            </Box>
            <Box sx={{ mt: 2 }}>
              <Typography gutterBottom>Pressure (psi)</Typography>
              <Slider
                value={selectedDevice.pressure.slice(-1)[0]}
                onChange={(e, val) => handleSliderChange('pressure', val)}
                min={0}
                max={200}
                step={1}
              />
            </Box>
            <Box sx={{ mt: 2 }}>
              <Typography gutterBottom>Temperature (Â°C)</Typography>
              <Slider
                value={selectedDevice.temperature.slice(-1)[0]}
                onChange={(e, val) => handleSliderChange('temperature', val)}
                min={-10}
                max={50}
                step={1}
              />
            </Box>
          </DialogContent>
          <DialogActions>
            <Button onClick={handleEditDialogClose}>Close</Button>
          </DialogActions>
        </Dialog>
      )}

      {devices.map(device => (
        <DeviceAnalytics key={device.Did} deviceId={device.Did} />
      ))}
    </Container>
  );
}

export default App;
